INSERT INTO `Show_Comment` (`Type`, `Item`, `Comment`) VALUES
('常吃的飲食', '五榖飯 + 胡麻豆腐', '您經常吃【五穀飯＋胡麻豆腐】這類搭配組合，飲食上較為均衡，飲食建議上每日二杯奶、每餐飯及蔬菜要比拳頭大，每餐蛋豆魚肉一掌心，每餐水果拳頭大，每餐堅果一茶匙，堅持均衡飲食，一定呷百二。'),
('感興趣主題', '健康窈窕減少負擔', '建議健康地進行飲食控制，每日熱量攝取需低於TDEE並配合運動。執行營養均衡飲食，三餐定時定量，對於六大類食物要適量攝取，不可採用不健康的低醣高蛋白或長期高纖維飲食，以免造成身體的傷害。配合恆久適當的運動，消耗多餘的熱量，以達到減重的效果。'),
('感興趣主題', '增肌打底補給能量', '近幾年大家對防範肌少症的觀念提高、健身的風氣盛行，增肌飲食建議每日每公斤 1.5～2 公克蛋白質，以體重60公斤為例，每日蛋白質建議量為公克。蛋白質攝取以優質蛋白質為佳，如魚類、肉類、奶類及蛋類等，且每週均需攝取植物性蛋白，如：大豆、豆製品、蔬菜（馬鈴薯、胡蘿蔔、白蘿蔔、白 花椰菜、波菜、甘藍菜）或水果（香蕉、柑橘、番茄、蘋果），避免吃加工類食品。'),
('感興趣主題', '擺脫三高健檢紅字', '三高指的是高血壓，高血糖，高血脂。維持理想體重及均衡飲食是控制三高或預防三高的主要方式。高血壓的飲食原則，如減少鹽分的攝取、限制鈉含量較高的食物；高血糖的飲食原則，應控制熱量高的食物、少吃精緻醣類、少喝含糖飲料、少吃油炸或煎炒的食物，盡量以水煮、清蒸、烤或涼拌等烹調方式；高血脂的飲食原則，宜少油、少糖、少吃高膽固醇食物。除了的飲食之外，足夠和規律的運動互相搭配，才能降低三高造成的健康風險。'),
('日常小困擾', '時常腰痠背痛', '腰痠背痛可能源於缺乏營養素，【鈣】對骨骼和肌肉功能有關鍵作用。【鎂】有助於肌肉放鬆。【鐵】和【鋅】對身體代謝和修復有助，缺乏可能導致疲勞、疼痛。缺乏【維生素D】可能造成骨痛，而缺乏【維生素B群】可能引發神經痛。'),
('日常小困擾', '時常輾轉難眠', '時常輾轉難眠，你可能缺乏微量營養素：鈣、鎂、鋅和維生素B6，進而影響睡眠品質。【鈣】、【鎂】除了有助於維持骨骼健康，也具有安定神經、幫助放鬆的作用。【鋅】能促進褪黑激素合成與釋放，調節睡眠節奏。【維生素B6】可以幫助多巴胺和 γ-氨基丁酸（GABA）等物質產生，多巴胺也就是常聽到的快樂荷爾蒙，產生開心的感覺，幫助心情放鬆。'),
('日常小困擾', '有時莫名頭痛', '有時莫名頭痛，可能源於缺乏營養素：維生素B12、菸鹼酸等，有助維持能量代謝，缺乏可能會造成頭痛。【鐵質】有助氧氣運輸與利用，若欠缺就會容易感頭暈頭痛。'),
('日常小困擾', '有時貧血頭暈', '日常若常有貧血頭暈的困擾，請注意你可能不只有缺鐵，也有可能是身體也缺乏微量營養素：維生素B6、維生素B12和葉酸。【鐵】是造血的營養元素之一，【維生素B12】參與紅血球形成，而【葉酸】【維生素B6】共同參與體內血球運作。建議多補充瘦肉、綠葉蔬菜、蛋豆類、堅果等來獲得這些營養素。'),
('日常小困擾', '沒太多小毛病', '很棒喔，繼續維持。'),
('常吃的飲食', '滷肉飯（或乾麵）+ 台式小菜', '您經常吃【滷肉飯+台式小菜】這類搭配組合，飲食較為均衡，但仍需控制份量，選擇健康的碳水化合物來源，例如未精緻五穀根莖類，並限制攝取糖分高的飲料、甜品的次數。'),
('常吃的飲食', '漢堡 + 薯條 + 汽水', '您經常吃【漢堡薯條＋汽水】這類搭配組合，都是糖份含量高的加工食品，攝取過多澱粉，膳食纖維攝取不足，雖能迅速提供能量但也導致血糖波動大，容易過量攝取熱量，長期下來不利體重控制及飲食不均。在飲食中加入富含膳食纖維食物，例如燕麥、五穀米等，且含更多營養素，持久能量又穩定血糖。'),
('常吃的飲食', '無合適選項', '建議將您的飲食拍照上傳至平台上，由營養師解簽您的疑惑，謝謝！'),
('常吃的飲食', '燒肉 + 啤酒 + 烤麻糬', '您經常吃【燒肉+啤酒＋烤麻糬】這類搭配組合，攝取較多的動物性蛋白，其含較高的脂肪及膽固醇，容易增加負擔，加上搭配啤酒、烤麻糬等，可能導致血糖波動大、體重增加和心血管疾病風險。建議增加蔬菜串和植物性蛋白的攝取比例，平時養成定期運動的習慣。'),
('常吃的飲食', '燒餅油條（或包子、饅頭）+ 無糖豆漿', '您經常吃【燒餅油條＋無糖豆漿】這類搭配組合，缺乏蔬菜類攝取，飲食不均，且血糖較不穩定。不過，黃豆、黑豆等豆類擁有的優植物性蛋白提供必需胺基酸及膳食纖維，不含膽固醇與較低的飽和脂肪含量。但建議可以蔬菜蛋餅替換燒餅油條，確保血糖穩定，長期更健康。'),
('感興趣主題', '特殊的飲食建議', '1.癌症：癌症患者因新陳代謝和荷爾蒙變化，蛋白質流失加劇，均衡攝取六大類食物外，著重注意攝取充足熱量和優質蛋白建議治療期間，每日攝取量為體重乘以1~1.5公克的蛋白質。選擇熟食、避免生食，以免感染風險。食慾不振時，少量多餐，選擇高熱量食物，多種烹調方式有助提升食慾。\r\n2.腎病：腎病患者應攝取充足熱量，每日攝取量為體重乘以25~35卡的熱量，避免因能量不足分解肌肉，增加腎臟負擔。未進行透析的患者，應遵循「低蛋白飲食原則」，每日攝取量為體重乘以0.6~0.8公克的蛋白質，並建議以植物性蛋白為主，伴隨攝取脂肪、膽固醇更低量。優質蛋白應至少占總攝取量的50%。管理飲食，降低鈉、磷、鉀攝取，控制水分，減輕腎臟和心臟負擔、避免骨質疏鬆。\r\n'),
('日常小困擾', '眼睛乾澀疲勞', '眼睛乾澀疲勞，可能源於缺乏維生素B2、維生素A，缺乏可能會造成結膜充血、怕光或乾眼症。'),
('日常小困擾', '經常覺得疲憊', '常感到疲勞、提不起勁？可能源於缺乏營養素：【維生素B群】如維生素B1、B2、菸鹼素與維生素B12等，有助維持能量代謝，缺乏可能會造成疲倦。【鐵質】有助氧氣運輸與利用、【鋅】使體內酵素正常作用，這些礦物質若欠缺就會容易感到疲憊無力。'),
('常吃的飲食', '義大利麵 + 木盆沙拉', '您經常吃【義大利麵＋木盆沙拉】這類搭配組合，飲食均衡及足夠的熱量，有助於控制血糖和體重，但在需要快速補充能量的情況（例如運動後）時，可補充含醣類高的食物，例：水果及五穀雜糧類，香蕉、奇異果、烤地瓜等。'),
('日常小困擾', '莫名感到鬱卒', '有時候莫名感到鬱卒、心情浮躁，和缺乏營養素有關。【Omega-3脂肪酸】為不飽和脂肪酸，有助神經傳導、血液流動與調節壓力荷爾蒙，缺乏的話可能會影響情緒。蛋白質是血清素的關鍵原料，缺乏【優質蛋白】也可能使快樂荷爾蒙製造不足而造成情緒低落。【鉻】有助於維持醣類代謝、降低負面情緒。【維生素B6】可以幫助多巴胺和 γ-氨基丁酸（GABA）等物質產生，多巴胺也就是常聽到的快樂荷爾蒙，產生開心的感覺，幫助心情放鬆。'),
('感興趣主題', '輕輕鬆鬆血糖管理', '良好血糖飲食原則，應採均衡飲食、少量多餐、少吃精緻醣類、少喝含糖飲料、少吃油炸或煎炒的食物、避免喝酒，食物盡量以水煮、清蒸、烤或涼拌等烹調方式。食物調味宜清淡，勿太鹹，少吃罐頭及醃製品、避免吃芶芡之濃湯。烹調時勿加糖，必要時可用低熱量之代糖取代。調味料(沙拉醬、辣椒醬、醬油膏)建議放在小碟子少量沾取勿吃太多。');
